import React, { useEffect, useState } from 'react';
import './DVLeadView.css';

const columns = [
  { key: 'id', label: 'ID' },
  { key: 'module', label: 'Module' },
  { key: 'tb_dev_total', label: 'TB Dev Total' },
  { key: 'tb_dev_coded', label: 'TB Dev Coded' },
  { key: 'test_total', label: 'Test Total' },
  { key: 'test_coded', label: 'Test Coded' },
  { key: 'test_pass', label: 'Test Pass' },
  { key: 'test_fail', label: 'Test Fail' },
  { key: 'assert_total', label: 'Assert Total' },
  { key: 'assert_coded', label: 'Assert Coded' },
  { key: 'assert_pass', label: 'Assert Pass' },
  { key: 'assert_fail', label: 'Assert Fail' },
  { key: 'code_coverage_percent', label: 'Code Coverage (%)' },
  { key: 'functional_coverage_percent', label: 'Functional Coverage (%)' },
  { key: 'req_total', label: 'Req Total' },
  { key: 'req_covered', label: 'Req Covered' },
  { key: 'req_uncovered', label: 'Req Uncovered' },
  { key: 'block_status', label: 'Block Status' },
  { key: 'collected_by', label: 'Collected By' },
  { key: 'collected_at', label: 'Collected At' },
  { key: 'updated_at', label: 'Updated At' },
  { key: 'is_deleted', label: 'Is Deleted' },
];

function DVLeadView() {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [moduleFilter, setModuleFilter] = useState('');

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = () => {
    setLoading(true);
    setError(null);
    fetch('/api/dv-data')
      .then(res => res.json())
      .then(json => setData(Array.isArray(json) ? json : []))
      .catch(err => setError('Failed to fetch DV data'))
      .finally(() => setLoading(false));
  };

  // Module filter options
  const modules = Array.from(new Set(data.map(row => row.module).filter(Boolean)));
  const filteredData = moduleFilter ? data.filter(row => row.module === moduleFilter) : data;

  // Summary stats
  const total = filteredData.length;
  const pass = filteredData.filter(row => (row.block_status || '').toLowerCase() === 'complete').length;
  const fail = filteredData.filter(row => (row.block_status || '').toLowerCase() === 'fail').length;
  const partial = filteredData.filter(row => (row.block_status || '').toLowerCase() === 'partial').length;

  if (loading) {
    return (
      <div className="dv-lead-view">
        <div className="dv-loading-container">
          <div className="dv-loading-spinner"></div>
          <p>Loading DV lead data...</p>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="dv-lead-view">
        <div className="dv-error-container">
          <h3>Error</h3>
          <p>{error}</p>
          <button onClick={fetchData} className="btn btn-primary">Retry</button>
        </div>
      </div>
    );
  }

  return (
    <div className="dv-lead-view">
      {/* Header Section */}
      <div className="dv-view-header">
        <div className="header-content">
          <h2>DV Lead Dashboard</h2>
          <p>Comprehensive overview of all DV modules and their status</p>
        </div>
        <div className="header-actions">
          <button onClick={() => { setModuleFilter(''); fetchData(); }} className="btn btn-outline">Clear Filters</button>
          <button onClick={fetchData} className="btn btn-primary">Refresh</button>
        </div>
      </div>

      {/* Summary Stats */}
      <div className="dv-summary-stats">
        <span>Total: <b>{total}</b></span>
        <span>Complete: <b>{pass}</b></span>
        <span>Partial: <b>{partial}</b></span>
        <span>Fail: <b>{fail}</b></span>
      </div>

      {/* Module Filter */}
      <div style={{ margin: '16px 0' }}>
        <label htmlFor="module-filter" style={{ fontWeight: 600 }}>Module:</label>
        <select
          id="module-filter"
          value={moduleFilter}
          onChange={e => setModuleFilter(e.target.value)}
          style={{ padding: '8px 12px', borderRadius: 8, border: '1px solid #e2e8f0', fontSize: 14, marginLeft: 8 }}
        >
          <option value="">All</option>
          {modules.map(m => (
            <option key={m} value={m}>{m}</option>
          ))}
        </select>
      </div>

      {/* Data Table */}
      <div className="dv-data-table-container">
        <div className="dv-table-header">
          <h3>Table: <span style={{ color: '#1e293b' }}>dv_data_raw</span></h3>
          <div className="dv-table-stats">
            <span>Showing {filteredData.length} of {data.length} records</span>
          </div>
        </div>
        <div style={{ overflowX: 'auto', width: '100%' }}>
          <table className="dv-lead-table" border={1} cellPadding={6} cellSpacing={0} style={{ minWidth: 1200 }}>
            <thead>
              <tr>
                {columns.map(col => (
                  <th key={col.key}>{col.label}</th>
                ))}
              </tr>
            </thead>
            <tbody>
              {filteredData.length === 0 ? (
                <tr><td colSpan={columns.length}>No DV data found.</td></tr>
              ) : (
                filteredData.map((row, idx) => (
                  <tr key={row.id || idx}>
                    {columns.map(col => (
                      <td key={col.key}>{row[col.key] ?? 'N/A'}</td>
                    ))}
                  </tr>
                ))
              )}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
}
export default DVLeadView;
